import AppLayout from '../components/AppLayout';
import Head from 'next/head';

const Profile = () => {
  return (
    <>
      <Head>
        <title>내 프로필</title>
      </Head>
      <AppLayout>
        <NicknameEditForm />
        <FollowingList header="팔로잉목록" />
        <FollowerList header="팔로워목록" />
      </AppLayout>
    </>
  );
};

export default Profile;
